sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
    var arrayUtil = new global.ArrayUtil();
  	var response = JSON.parse(inputs.response_body);
    if (arrayUtil.contains(successCodes, inputs.status)) {
        outputs.status = 'Success';
      	if(JSON.stringify(response.value) != '{}')
          outputs.schedules_details = response.value;
      	var schedules = [];
        var data = [];
        response.value.forEach(function(property) {
            schedules.push({
                label: property.name,
                name: property.name
            });
        });
        outputs.schedules = {
            data: schedules
        };
    } else {
        outputs.status = 'Error';
        if (response.message)
            outputs.error_message = response.message;
        else
            outputs.error_message = response.error.message;
    }
})(inputs, outputs);

